// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;
import "../ReguladorMercado.sol";

abstract contract Agente {
    address public reguladorMercado;
    address public owner;
    address public dirContrato;
    address public nullAddress = 0x0000000000000000000000000000000000000000;

    modifier authorize(address _direction) {
        require(
            _direction == owner,
            "No tiene permisos para ejecutar la transaccion"
        );
        _;
    }

    function comprarTokens(uint256 cantidad)
        public
        payable
        authorize(msg.sender)
    {
        uint256 returnValue = ReguladorMercado(reguladorMercado).ComprarTokens(
            msg.value,
            cantidad,
            msg.sender
        );
        payable(msg.sender).transfer(returnValue);
    }

    function DevolverTokens(uint256 numeroTokens)
        public
        payable
        authorize(msg.sender)
    {
        uint256 precioTokens = ReguladorMercado(reguladorMercado)
            .DevolverTokens(numeroTokens, msg.sender);
        // uint256 prueba = 5 * (1e15);
        require(address(this).balance >=1, "Contract underfunded");
        payable(msg.sender).transfer(precioTokens);
    }

    function MisTokens() public view returns (uint256) {
        return ReguladorMercado(reguladorMercado).MisTokens(msg.sender);
    }

    function getBalanceContract () public view returns (uint256) {
        return address(this).balance;
    }
}

// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;
import "../ReguladorMercado.sol";
import "./InfoContrato.sol";

abstract contract Agente {
    address public reguladorMercado;
    InfoContrato infoContrato;
    address public nullAddress = 0x0000000000000000000000000000000000000000;

    modifier authorize(address _direction) {
        require(
            _direction == infoContrato.owner,
            "No tiene permisos para ejecutar la transaccion"
        );
        _;
    }

    function MisTokens() public view returns (uint256) {
        return ReguladorMercado(reguladorMercado).MisTokens(msg.sender);
    }

    function getInfoContrato() public view returns (InfoContrato memory) {
        return infoContrato;
    }
}
